	<section class="title" style="background:#fff url(https://www.visitdublin.com/getmedia/519fc7f8-d363-408d-8c2e-e2e8d5a3f421/Liffey_View_1150x500.jpg.aspx?width=1150&height=500&ext=.jpg)" aria-label="The famous Guinness Brewery black gates">
		<h1 style="background-image :url('../img/10.jpg')">Things to Do in Dublin</h1>
	</section>
</div>

<div class="small-12 medium-12 large-12 columns">

	<!--meta info-->


	<!--sub title/intro-->
	<h2 class="intro">On a visit to Dublin, you can get lost in the wonders of our museums, savour some delicious traditional dishes and meander through the laneways and cobbled Streets. Use the Dublin Discovery Trails App to choose some interesting routes around Dublin that introduce you to the geography of the city and tell you something about our history.</h2>

</div>
      <div class="small-12 medium-12 large-12 columns">
        <div class="wysiwyg">
          <h4>1. An introduction to Dublin</h4>

<p>The <a href="https://www.visitdublin.com/getattachment/Insider-Tips/February-2018/thingstodoindublin/Little_Museum_810x300.jpg.aspx" target="_blank">Little Museum of Dublin</a> continues to rank highly with visitors as an ideal and&nbsp;entertaining way to get an introduction to Dublin.<br />
<br />
Another attraction known as <a href="/see-do/details/epic-the-irish-emigration-museum#53.348294|-6.248112|13" target="_blank">EPIC</a> boasts the tagline &ldquo;Everybody is connected&rdquo;, and&nbsp;taps in to the Irish diaspora. The visitor is guided on a journey to discover the stories of Irish emigration around the world, from early times to the modern day.</p>
<img alt="Sign for The Little Museum of Dublin" src="https://www.visitdublin.com/getattachment/Insider-Tips/February-2018/thingstodoindublin/Little_Museum_810x300.jpg.aspx" title="Little_Museum_810x300.jpg" />
<p style="text-align: center;"><em>Sign for The Little Museum of Dublin</em></p>

<h4>2. Dublin attractions</h4>

<p>Dublin is the little city that packs a big punch. <a href="/see-do/visitor-attractions/top-visitor-attractions" target="_blank">Enjoy&nbsp;some of our top attractions</a>, from Guinness Storehouse to the Book of Kells.&nbsp;</p>
<img alt="People admiring exhibition at the Long Room in Trinity College" src="https://www.visitdublin.com/getattachment/Insider-Tips/February-2018/thingstodoindublin/The_Long_Room_810x300.jpg.aspx" title="The_Long_Room_810x300.jpg" />
<p style="text-align: center;"><em>The Book of Kells exhibition</em></p>

<h4>3. Trails &amp; shortcuts</h4>

<p>Take advantage of our<a href="/see-do/dublin-discovery-trails" target="_blank">&nbsp;free Dublin Discovery Trails app</a>. The trails bring you on themed journeys through the winding streets of Dublin. Follow trails like Rebellion and&nbsp;Dublin&rsquo;s Military History. Best of all, you can plan all this in advance and&nbsp;then follow them at your own pace when you arrive in the city.</p>
<img alt="View of the Garden of Remembrance on a sunny day" src="https://www.visitdublin.com/getattachment/Insider-Tips/February-2018/thingstodoindublin/Garden_of_Remembrance_810x300.jpg.aspx" title="Garden_of_Remembrance_810x300.jpg" />
<p style="text-align: center;"><em>The Garden of Remembrance</em></p>

<h4>4. Dublin on a budget</h4>

<p>You can experience a great weekend in Dublin even on a limited budget. Here, we&rsquo;ve selected a budget-friendly itinerary of things to do, delicious places to eat and fun activities to try over 48 hours. <a href="/dublin-on-a-budget" target="_blank">Read our guide to enjoying Dublin&nbsp;without breaking the bank</a>.</p>
<img alt="Chester Beatty Library and garden" src="https://www.visitdublin.com/getattachment/Insider-Tips/February-2018/thingstodoindublin/Chester_Beatty_Garden_810x300.jpg.aspx" title="Chester_Beatty_Garden_810x300.jpg" />
<p style="text-align: center;"><em>Chester Beatty Library and the Dubh Linn Garden</em></p>

<h4>5. Experience Irish food</h4>

<p>Dublin&rsquo;s culinary scene has changed considerably in recent years, and the Irish capital is now bursting with creative <a href="/irish-food-in-dublin" target="_blank">chefs, cafés and restaurants serving tasty Irish fare</a> and highlighting the best of Irish ingredients.</p>
<img alt="Platter of Irish seafood" src="https://www.visitdublin.com/getattachment/Insider-Tips/February-2018/thingstodoindublin/Seafood_810x300-(1).jpg.aspx" title="Seafood_810x300-(1).jpg" />
<p style="text-align: center;"><em>Irish seafood platter</em></p>

<h4>6. Free things to do in Dublin</h4>

<p>From walking through wonderful parks to popping in to one of the many free events around Dublin, you&#39;ll&nbsp;find something to do in Dublin that won&#39;t break the bank.<br />
&nbsp;<br />
Dublin is well known for its generous green spaces and&nbsp;<a href="/parks-of-dublin" target="_blank">beautiful parks</a>.&nbsp;<br />
&nbsp;<br />
Many of our museums have free entry&nbsp;&ndash;&nbsp;<a href="/see-do/details/chester-beatty-library-2#53.342270|-6.267466|13" target="_blank">Chester Beatty Library</a>, <a href="/see-do/details/national-gallery-of-ireland#53.340892|-6.252491|13" target="_blank">National Gallery</a>&nbsp;and&nbsp;the <a href="/see-do/details/dublin-city-gallery-the-hugh-lane#53.354215|-6.264711|13" target="_blank">Hugh Lane Gallery</a> to name but a few.&nbsp;<br />
&nbsp;<br />
In any given week, Dublin boasts an eclectic mix of events that are free of charge. <a href="/whats-on/free-events" target="_blank">Check out the best upcoming free events in Dublin</a>.</p>
<img alt="Interior of Hugh Lane gallery" src="https://www.visitdublin.com/getattachment/Insider-Tips/February-2018/thingstodoindublin/Hugh_Lane_Interior_810x300.jpg.aspx" title="Hugh_Lane_Interior_810x300.jpg" />
<p style="text-align: center;"><em>Interior of the Hugh Lane Gallery</em></p>





